import React, { useState, useEffect } from 'react';
import { API_BASE_URL } from '../constant';

export default function AddAirplane() {
  const [tailNum, setTailNum] = useState('');
  const [model, setModel] = useState('');
  const [seatCapacity, setSeatCapacity] = useState('');
  const [manufacturingYear, setManufacturingYear] = useState('');
  const [maintenanced, setMaintenanced] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Set the document title
    document.title = 'Add Airplane | Airline Management System';
  }, []);

  const handleAddAirplane = async () => {
    setLoading(true);

    if (!tailNum || !model) {
      alert('Tail Number and Aircraft Model are required.');
      setLoading(false);
      return;
    }

    try {
      const response = await fetch(`${API_BASE_URL}/procedures/add_airplane`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          tail_num: tailNum,
          model: model,
          seat_capacity: parseInt(seatCapacity) || 0,
          manufacturingYear: manufacturingYear,
          maintenanced: maintenanced,
          // Including other required fields with default values
          airlineID: "DEFAULT",
          speed: 0,
          plane_type: model,
          locationID: "",
          neo: false,
        }),
      });

      if (response.ok) {
        // Reset form after successful submission
        setTailNum('');
        setModel('');
        setSeatCapacity('');
        setManufacturingYear('');
        setMaintenanced(false);
        
        // Navigate to dashboard or show success message
        alert('Airplane added successfully!');
      } else {
        const errorData = await response.json();
        alert(errorData.error || 'Failed to add airplane.');
      }
    } catch (err) {
      console.error('Error adding airplane:', err);
      alert('An unexpected error occurred.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: '800px', margin: '0 auto', padding: '20px' }}>
      <div style={{ marginBottom: '20px' }}>
        <a href="/" style={{ color: '#6366f1', textDecoration: 'none', display: 'inline-flex', alignItems: 'center' }}>
          <svg width="40" height="40" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg" style={{ marginRight: '10px' }}>
            <path d="M19 12H5" stroke="#6366f1" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            <path d="M12 19L5 12L12 5" stroke="#6366f1" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
          </svg>
          Back to Dashboard
        </a>
      </div>

      <div>
        <h1 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '10px', color: '#333' }}>
          Add Airplane
        </h1>
        <p style={{ color: '#666', marginBottom: '20px' }}>Register a new airplane in the system</p>

        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500' }}>Tail Number</label>
          <input
            type="text"
            style={{ 
              width: '100%', 
              padding: '8px 12px', 
              border: '1px solid #ccc', 
              borderRadius: '4px',
              fontSize: '16px'
            }}
            value={tailNum}
            onChange={(e) => setTailNum(e.target.value)}
            placeholder="e.g. N12345"
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500' }}>Aircraft Model</label>
          <input
            type="text"
            style={{ 
              width: '100%', 
              padding: '8px 12px', 
              border: '1px solid #ccc', 
              borderRadius: '4px',
              fontSize: '16px'
            }}
            value={model}
            onChange={(e) => setModel(e.target.value)}
            placeholder="e.g. Boeing 737-800"
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500' }}>Passenger Capacity</label>
          <input
            type="number"
            style={{ 
              width: '100%', 
              padding: '8px 12px', 
              border: '1px solid #ccc', 
              borderRadius: '4px',
              fontSize: '16px'
            }}
            value={seatCapacity}
            onChange={(e) => setSeatCapacity(e.target.value)}
            placeholder="e.g. 189"
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500' }}>Manufacturing Year</label>
          <input
            type="text"
            style={{ 
              width: '100%', 
              padding: '8px 12px', 
              border: '1px solid #ccc', 
              borderRadius: '4px',
              fontSize: '16px'
            }}
            value={manufacturingYear}
            onChange={(e) => setManufacturingYear(e.target.value)}
            placeholder="e.g. 2015"
          />
        </div>

        <div style={{ marginBottom: '20px' }}>
          <label style={{ display: 'flex', alignItems: 'center' }}>
            <input
              type="checkbox"
              style={{ marginRight: '10px' }}
              checked={maintenanced}
              onChange={(e) => setMaintenanced(e.target.checked)}
            />
            Aircraft is currently in maintenance
          </label>
        </div>

        <div>
          <button 
            onClick={handleAddAirplane} 
            disabled={loading}
            style={{ 
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              backgroundColor: loading ? '#93c5fd' : '#2563eb',
              color: 'white',
              padding: '10px 16px',
              border: 'none',
              borderRadius: '4px',
              fontSize: '16px',
              cursor: loading ? 'not-allowed' : 'pointer'
            }}
          >
            <span style={{ display: 'inline-block', marginRight: '8px' }}>+</span>
            Add Airplane
          </button>
        </div>
      </div>
    </div>
  );
}
